import React, { useState } from "react";

const Table = () => {
  const [inputs, setInputs] = useState({
    input1: "",
    input2: "",
    input3: "",
  });

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setInputs((prevInputs) => ({
      ...prevInputs,
      [name]: value,
    }));
  };

  return (
    <tr>
      <td>
        <input
          type="text"
          name="input1"
          value={inputs.input1}
          onChange={handleInputChange}
        />
      </td>
      <td>
        <input
          type="text"
          name="input2"
          value={inputs.input2}
          onChange={handleInputChange}
        />
      </td>
      <td>
        <input
          type="text"
          name="input3"
          value={inputs.input3}
          onChange={handleInputChange}
        />
      </td>
    </tr>
  );
};

export default Table;
